import React from 'react';

const Navbar = () => (
  <header>
    <nav>
      <h1 className="title">
        Bookstore CMS
      </h1>
      <p className="book-header-title">Books</p>
      <p className="cat-header-title">Categories</p>
    </nav>
  </header>
);

export default Navbar;
